import React from "react";
import CommonBanner from "../../common/banner/CommonBanner";
import Footer from "../../common/footer/Footer";
import Header from "../../common/header/Header";
import InfoSection from "../../common/infoSection/InfoSection";

class DigitalMarketing extends React.Component {
  render() {
    return (
      <>
        <Header />
        <CommonBanner>Digital Marketing</CommonBanner>
        <InfoSection
          name="A leading partner in many IT Companies"
          title="Delivering value-driven solutions with innovation"
        ></InfoSection>
        <Footer />
      </>
    );
  }
}
export default DigitalMarketing;
